const Pokemon = ({name,image,}) => {
  return (
    <div className='basis-[20%] h-[400px] w-[300px] flex flex-col  items-center'>
      <div>{name}</div>
      <div><img src={image} className='max-h-full h-[150px]'/></div>
    </div>
  )
}

export default Pokemon
